     var svgDocument, svgRoot;

        function init (evt)
        {
			if ( window.svgDocument == null )
				svgDocument = evt.target.ownerDocument;
			svgRoot = svgDocument.documentElement;

            document.getElementById("fondecran").setAttribute('fill', '#eeeeee');
			document.getElementById("fondecran").setAttribute('width', "100%");
			document.getElementById("fondecran").setAttribute('height', "100%");

            showTime ();
            setInterval ("showTime ()", 1000);
        }

        function showTime ()
        {
            var Actuel = new Date();
            var Seconds = (Actuel.getSeconds()*6)-1;
            var Minutes = Actuel.getMinutes();
            var Hours   = Actuel.getHours() ;

            document.getElementById("txtsec").setAttribute('transform', 'rotate(' + (-Seconds) + ' -400 590)');
            document.getElementById("txtmin").setAttribute('transform', 'rotate(' + (-Minutes*6) + ' -400 590)');
            document.getElementById("txtheure").setAttribute('transform', 'rotate(' + (-Hours * 30) + ' -400 590)');


       }


































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































